import React from 'react';
import Common from './Common';


const Aim = () => {
    return (
        <>
            <Common  hname=' G ' bname='d'  pname='Association of Civil Engineers, B.I.T. Sindri aims to enlighten students, scholars and researchers of the most recent advancements in the Civil Engineering field. It aspires to foster a culture of learning, understanding and sharing of Civil engineering concepts in the campus so that there is no dearth of information and an open along with free flow of knowledge. We want more people to join us in the movement so that we learn and innovate together.'/>

        </>
    )
}

export default Aim;
